const startTest = ()=>{
    setIsShown(true);
    console.log(questions)
    // get_Questions()
  }

  return (
    <div className="container ">
      <div className='start_btn'>
    <Button text ='Practice Test' fun={startTest}/>
      </div>
      {/* if exam started show questions */}
      {isShown&&(
        <div>
          <Questions questions = {questions}/>
        </div>
          )}
    <div>
      <Rank/>
    </div>

    </div>
  );
}

export default App;
